[{"location":"reference/","page":"Reference","title":"Reference","text":"","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"Modules  = [DiffusionGarnet]","category":"page"},{"location":"reference/#DiffusionGarnet.InitialConditions1D-Tuple{Vector{<:Real}, Vector{<:Real}, Vector{<:Real}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð“, U}, Level{L, S, Quantity{T, ð“, U}} where {L, S}} where {T, U}}","page":"Reference","title":"DiffusionGarnet.InitialConditions1D","text":"InitialConditions1D(CMg0::Array{<:Real, 1}, CFe0::Array{<:Real, 1}, CMn0::Array{<:Real, 1}, Lx::Unitful.Length, tfinal::Unitful.Time)\n\nReturn a structure containing the initial conditions for a 1D diffusion problem. CMg0, CFe0 and CMn0 need to be in mass fraction. Convert the Lxandtfinal`` to Âµm and Myr respectively.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.InitialConditions2D-Tuple{Matrix{<:Real}, Matrix{<:Real}, Matrix{<:Real}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð“, U}, Level{L, S, Quantity{T, ð“, U}} where {L, S}} where {T, U}}","page":"Reference","title":"DiffusionGarnet.InitialConditions2D","text":"InitialConditions2D(CMg0::Array{<:Real, 2}, CFe0::Array{<:Real, 2}, CMn0::Array{<:Real, 2}, Lx::Unitful.Length, Ly::Unitful.Length, tfinal::Unitful.Time)\n\nReturn a structure containing the initial conditions for a 2D diffusion problem. CMg0, CFe0 and CMn0 need to be in mass fraction. Convert Lx, Ly and tfinal to Âµm, Âµm and Myr respectively.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.InitialConditions3D-Tuple{Array{<:Real, 3}, Array{<:Real, 3}, Array{<:Real, 3}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð“, U}, Level{L, S, Quantity{T, ð“, U}} where {L, S}} where {T, U}}","page":"Reference","title":"DiffusionGarnet.InitialConditions3D","text":"InitialConditions3D(CMg0::Array{<:Real, 3}, CFe0::Array{<:Real, 3}, CMn0::Array{<:Real, 3}, Lx::Unitful.Length, Ly::Unitful.Length, Lz::Unitful.Length, tfinal::Unitful.Time)\n\nReturn a structure containing the initial conditions for a 3D diffusion problem. CMg0, CFe0 and CMn0 need to be in mass fraction. Convert Lx, Ly, Lz and tfinal to Âµm, Âµm, Âµm and Myr respectively.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.InitialConditionsSpherical-Tuple{Vector{<:Real}, Vector{<:Real}, Vector{<:Real}, Union{Quantity{T, ð‹, U}, Level{L, S, Quantity{T, ð‹, U}} where {L, S}} where {T, U}, Union{Quantity{T, ð“, U}, Level{L, S, Quantity{T, ð“, U}} where {L, S}} where {T, U}}","page":"Reference","title":"DiffusionGarnet.InitialConditionsSpherical","text":"InitialConditionsSpherical(CMg0::Array{<:Real, 1}, CFe0::Array{<:Real, 1}, CMn0::Array{<:Real, 1}, Lr::Unitful.Length, tfinal::Unitful.Time)\n\nReturn a structure containing the initial conditions for a spherical diffusion problem. CMg0, CFe0 and CMn0 need to be in mass fraction. Convert Lr and tfinal to Âµm and Myr respectively.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.Domain","page":"Reference","title":"DiffusionGarnet.Domain","text":"Domain(IC::InitialConditions2D, T::Union{Unitful.Temperature,Array{<:Unitful.Temperature{<:Real}, 1}}, P::Union{Unitful.Pressure,Array{<:Unitful.Pressure{<:Real}, 1}}, time_update::Union{Unitful.Time,Array{<:Unitful.Time{<:Real}, 1}}=0u\"Myr\")\n\nWhen applied to 2D initial conditions, define corresponding 2D domain.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.Domain-2","page":"Reference","title":"DiffusionGarnet.Domain","text":"Domain(IC::InitialConditions1D, T::Union{Unitful.Temperature,Array{<:Unitful.Temperature{<:Real}, 1}}, P::Union{Unitful.Pressure,Array{<:Unitful.Pressure{<:Real}, 1}}, time_update::Union{Unitful.Time,Array{<:Unitful.Time{<:Real}, 1}}=0u\"Myr\"; bc_neumann::Tuple=(false, false))\n\nWhen applied to 1D initial conditions, define corresponding 1D domain. bc_neumann can be used to define Neumann boundary conditions on the left or right of the domain if set to true.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.Domain-3","page":"Reference","title":"DiffusionGarnet.Domain","text":"Domain(IC::InitialConditions3D, T::Union{Unitful.Temperature,Array{<:Unitful.Temperature{<:Real}, 1}}, P::Union{Unitful.Pressure,Array{<:Unitful.Pressure{<:Real}, 1}}, time_update::Union{Unitful.Time,Array{<:Unitful.Time{<:Real}, 1}}=0u\"Myr\")\n\nWhen applied to 3D initial conditions, define corresponding 3D domain.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.Domain-4","page":"Reference","title":"DiffusionGarnet.Domain","text":"Domain(IC::InitialConditionsSpherical, T::Union{Unitful.Temperature,Array{<:Unitful.Temperature{<:Real}, 1}}, P::Union{Unitful.Pressure,Array{<:Unitful.Pressure{<:Real}, 1}}, time_update::Union{Unitful.Time,Array{<:Unitful.Time{<:Real}, 1}}=0u\"Myr\")\n\nWhen applied to spherical initial conditions, define corresponding spherical domain.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.Domain-5","page":"Reference","title":"DiffusionGarnet.Domain","text":"Domain(IC, T, P, time_update=0u\"Myr\")\n\nReturn a struct containing the struct IC, the PT conditions T and P  and the nondimensionalised parameters of the problem. time_update can be used to update the PT conditions during the simulation. If so, T and P have to be of the same size as time_update and correspond to the values of PT to update to.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.simulate","page":"Reference","title":"DiffusionGarnet.simulate","text":"simulate(domain; callback=nothing)\n\nSolve the coupled diffusion equation using finite differences for a given domain and return a solution type variable.\n\nThe time discretisation is based on the ROCK2 method, a stabilized explicit method (Adbdulle and Medovikov, 2001 ; https://doi.org/10.1007/s002110100292) using OrdinaryDiffEq.jl.\n\nThe solution type variable is following the format of OrdinaryDiffEq.jl (see https://docs.sciml.ai/DiffEqDocs/stable/basics/solution/), and can be used to plot the solution, and to extract the solution at a given time. As the system is nondimensionalised, the time of the solution is in nondimensional time.\n\ncallbacks is an optional argument, which can be used to pass a callback function to the solver. It follows the format of DiffEqCallbacks.jl (see https://docs.sciml.ai/DiffEqCallbacks/stable/).\n\n\n\n\n\n","category":"function"},{"location":"reference/#DiffusionGarnet.simulate-Tuple{DiffusionGarnet.Domain1D}","page":"Reference","title":"DiffusionGarnet.simulate","text":"simulate(domain::Domain1D; callback=nothing)\n\nSolve the coupled diffusion equation in 1D. Save all timesteps in the output solution type variable.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.simulate-Tuple{DiffusionGarnet.DomainSpherical}","page":"Reference","title":"DiffusionGarnet.simulate","text":"simulate(domain::DomainSpherical; callback=nothing)\n\nSolve the coupled diffusion equation in spherical coordinates. Save all timesteps in the output solution type variable.\n\n\n\n\n\n","category":"method"},{"location":"reference/#DiffusionGarnet.update_diffusion_coef-Tuple{Any}","page":"Reference","title":"DiffusionGarnet.update_diffusion_coef","text":"update_diffusion_coef(integrator)\n\nCallback function to update the diffusion coefficients at a given time from a new pressure and temperature. To use with the callback PresetTimeCallback (https://docs.sciml.ai/stable/basics/callbacks/#PresetTimeCallback-1).\n\nFollows the syntax of callback functions defined by DiffEqCallbacks.jl (https://docs.sciml.ai/DiffEqCallbacks/stable/).\n\n\n\n\n\n","category":"method"},{"location":"#DiffusionGarnet.jl","page":"Home","title":"DiffusionGarnet.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Garnet is a mineral commonly used in metamorphic petrology to better understand geological processes as it is present in various different rock types. This mineral commonly shows a wide spread of compositional zoning that has been interpreted as recording ranges of pressure (P) and temperature (T) conditions. Modelling diffusion processes can help to better understand this zoning and better constrain the pressure-temperature-time (PTt) conditions of the metamorphic event of interest.","category":"page"},{"location":"","page":"Home","title":"Home","text":"DiffusionGarnet is a Julia package that can be used to model coupled diffusion of major elements on real garnet data. It currently supports 1D and spherical coordinates for evenly spaced data and is soon to be extended to support 2D and 3D coordinates.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"DiffusionGarnet may be installed directly with the Julia package manager from the REPL:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia>]\n  pkg> add DiffusionGarnet\n  pkg> test DiffusionGarnet","category":"page"},{"location":"#Quick-Start","page":"Home","title":"Quick Start","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"DiffusionGarnet requires input data for the initial Mg, Fe and Mn mass fractions. ","category":"page"},{"location":"","page":"Home","title":"Home","text":"# load the data of your choice (here from the text file located in https://github.com/Iddingsite/DiffusionGarnet.jl/tree/main/examples/1D, place it in the same folder as where you are running the code)\ndata = DelimitedFiles.readdlm(\"./Data_Grt_1D.txt\", '\\t', '\\n', header=true)[1]\n\nMg0 = data[:, 4]\nFe0 = data[:, 2]\nMn0 = data[:, 3]\nCa0 = data[:, 5]\ndistance = data[:, 1]\nLx = (data[end,1] - data[1,1])u\"Âµm\"  # length in x of the model\ntfinal = 15u\"Myr\"  # total time of the model\n\n# define the initial conditions in 1D of your problem\nIC1D = InitialConditions1D(Mg0, Fe0, Mn0, Lx, tfinal)\n\n# define the PT conditions\nT = 900u\"Â°C\"\nP = 0.6u\"GPa\"\n\n# define a Domain struct containing the definition of your problem\ndomain1D = Domain(IC1D, T, P)\n\n# solve the problem using DifferentialEquations.jl\nsol = simulate(domain1D)\n\n# you can now plot the solutions from the sol variable\n\n# extract characteristic time to convert back to dimensional time\n@unpack tfinal_ad, t_charact = domain1D\n\nanim = @animate for i = LinRange(0, tfinal_ad, 100)\n    l = @layout [a ; b]\n\n    p1 = plot(distance, Fe0, label=\"Fe initial\", linestyle = :dash, linewidth=1, dpi=200, title = \"Timestep = $(round(((i)* t_charact);digits=2)) Ma\", legend=:outerbottomright, linecolor=1,xlabel = \"Distance (Âµm)\")\n    p1 = plot!(distance, sol(i)[:,2], label=\"Fe\",linecolor=1, linewidth=1)\n\n\n    p2 = plot(distance, Mg0, label=\"Mg initial\", linestyle = :dash, linewidth=1, dpi=200,legend=:outerbottomright,linecolor=2,xlabel = \"Distance (Âµm)\")\n    p2 = plot!(distance, Mn0, label=\"Mn initial\", linestyle = :dash, linewidth=1, linecolor=3)\n    p2 = plot!(distance, Ca0, label=\"Ca initial\", linestyle = :dash, linewidth=1, linecolor=4)\n    p2 = plot!(distance, sol(i)[:,1], label=\"Mg\",linecolor=2, linewidth=1)\n\n    p2 = plot!(distance, sol(i)[:,3], label=\"Mn\", linecolor=3, linewidth=1)\n\n    p2 = plot!(distance, 1 .- sol(i)[:,1] .- sol(i)[:,2] .- sol(i)[:,3], label=\"Ca\", linecolor=4, linewidth=1)\n\n    plot(p1, p2, layout = l)\nend every 1\n\nprintln(\"Now, generating the gif...\")\ngif(anim, \"./Grt_1D_test.gif\", fps = 7)\nprintln(\"...Done!\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"Here is the resulting gif obtained:","category":"page"},{"location":"","page":"Home","title":"Home","text":"(Image: 1D diffusion profil of a garnet)","category":"page"},{"location":"","page":"Home","title":"Home","text":"It represents the compositional evolution of a 1D profil through a garnet grain with homogeneous dirichlet boundaries on both sides.","category":"page"}]
